import link from 'next/link';
import Header from './Header';
import Footer from './Footer';
import { route } from 'next/dist/next-server/server/router';

export default ({children ,title})=>(
    <section>
        <Header {...route}/>
            <title>{title}</title>

            {children}

        <Footer/>


    </section>
)
